OriginalAxioms:
:Acting rdfs:comment Being someone you arent.  Taking on a
            character role.  Someday this may be partially related to
            lying.  What actors do during plays.  What comedians might
            do as part of a joke.  Something children do for fun.

          Includes senses 3 and 5 of act in WordNet:
            3. 7 act, play, represent - play a role or part; Gielgud played Hamlet;
               She wants to act Lady Macbeth, but she is too young for the role;
               She played the servant to her husbands master
            5. 1 act, play, act as - pretend to have certain qualities or state of mind;
                He acted the idiot; She plays deaf when the news are bad

